import { createIcon } from "../icon/createIcon";

export const ThumbsUpSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ThumbsUpSolidIcon">
    <path d="M0 5h2v7H0V5zm7-1V1.5C7 .7 6.4 0 5.5 0H5c-.6 0-1 .4-1 1v2L3 5v6c0 .6.4 1 1 1h5.4c.4 0 .7-.2.9-.6l.504-1.068A12.49 12.49 0 0 0 12 5c0-.6-.4-1-1-1H7z" />
  </svg>,
  "ThumbsUpSolid",
  "thumbs up solid"
);
